import React from "react";
import "./style.css";

function Footer() {
  return (
    <footer className="footer">
      <p>❤️❤️❤️Shelly️</p>
        <p>
          &copy; 2020 made by Shelly Tan!
        </p>
    </footer>
  );
}

export default Footer;
